import React from 'react'

function  Header({handleTogleDarkMode}){

  return (    <div className='header'>
        <h1> Notes  </h1>
        <button className='save'
        onClick={
          ()=>(handleTogleDarkMode((prevDarkMode)=> !prevDarkMode )  )}    > Toggle Mode</button>
    </div>
  )
}

export default  Header
